script: |
  super -f text -I q11244.spq | sort > q11244.out

inputs:
  - name: q11244.spq
    data: |
      SELECT + tab1.col1 - - tab1.col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col2 NOT BETWEEN ( col2 ) AND col1 + col1 + + col2;
  - name: tab1

outputs:
  - name: q11244.out
    data: |
      29
      74
      93
